import React from 'react';
import './navbar.style.scss';
import {Link} from "react-router-dom";
import {connect} from "react-redux";
import {signOut} from "../../redux/signIn/signIn.actions";
import appData from "../../api/appData";
import CustomButton from "../custom-button/customButton.component";
const Navbar = ({signOut,isSignedIn,cart}) => {

    const signInOrOut = isSignedIn? <span onClick={async ()=>{
        signOut();
    }}>SIGN OUT</span>:<Link className={`navbar__item`} to={'/signin'}>SIGN IN</Link>;
    return (
        <div className="navbar ">
            <Link className={`navbar__item`} to={'/'}>NOCTEM</Link>

            <div className={`navbar-left collapse navbar collapse`} id="navbarSupportedContent">

                {/*<Link className={`navbar__item`} to={'/products/men/:item'}>MEN</Link>*/}
                {/*<Link className={`navbar__item`} to={'/women'}>WOMEN</Link>*/}
                {/*<Link className={`navbar__item`} to={'/'}>GIRLS</Link>*/}
                {/*<Link className={`navbar__item`} to={'/'}>BOYS</Link>*/}
                <ul className="navbar-nav navbar-left">
                    <li className={`nav-item`}>
                        <Link className={`nav-link`} to={`/products/men/:item`} >MEN</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>WOMEN <span className="sr-only">(current)</span></Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>GIRLS <span className="sr-only">(current)</span></Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>BOYS <span className="sr-only">(current)</span></Link>
                    </li>
                </ul>
            </div>
            <button className="navbar-toggler" type="button" data-toggle="collapse"
                    data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false"
                    aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>


            <div className={`navbar-right`}>

                <Link className={`navbar__item`} to={'/search'}>SEARCH</Link>
                {signInOrOut}
                <Link className={`navbar__item`} to={'/cart'}>CART</Link>
            </div>

        </div>
    );
};



const navbarBS = ()=>{

    return(
        <nav className="navbar ">
            <Link className="navbar-brand" to={`/`}>Noctem</Link>
            <div className={"navbar-right ml-auto"}>
                <span className={`navbar__item`}>SIGN IN</span>
                <span className={`navbar__item`}>CART</span>
            </div>


            <button className="navbar-toggler" type="button" data-toggle="collapse"
                    data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false"
                    aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto navbar-left">
                    <li className={`nav-item`}>
                        <Link className={`nav-link`} to={`/products/men/:item`} >MEN</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>WOMEN <span className="sr-only">(current)</span></Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>GIRLS <span className="sr-only">(current)</span></Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link" to={``}>BOYS <span className="sr-only">(current)</span></Link>
                    </li>
                </ul>
            </div>
        </nav>
    )


};

const mapStateToProps = state=>{
  return{
      isSignedIn:state.signIn.isSignedIn,
      cart:state.cart
  }
};

export default connect(mapStateToProps,{signOut})(Navbar);
